using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using UnityEngine;

public class CategoryView : MonoBehaviour
{
    public CategoryAdapter categoryAdapter;
    public List<Category> dbCategories;

    public void Start()
    {
        var dbInstance = SQLIteService.Instance;
        dbInstance.SaveCategory(new Category() { Name = "Amy", ImageBase64 = "" });
        dbInstance.SaveCategory(new Category() { Name = "Sonic", ImageBase64 = "" });
        dbInstance.SaveCategory(new Category() { Name = "Knuckles", ImageBase64 = "" });
        dbInstance.SaveCategory(new Category() { Name = "Tails", ImageBase64 = "" });
        dbCategories = dbInstance.GetCategories();
        categoryAdapter.AddCategoriesToContent(dbCategories.OrderBy(c => c.Name).ToList());
    }
}

